import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: 'e1', title: 'Sydny', amount: '94.08', date: new Date (2022, 7, 15),
    },
    {
      id: 'e2', title: 'Dubai', amount: '87.08', date: new Date (2022, 7, 15),
    },
    {
      id: 'e3', title: 'Pakistan', amount: '178.08', date: new Date (2022, 7, 15),
    }
  ]

  return (
    <div>
      <h2>Let's get started in REACT!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
